text:
La mañana de este miércoles, el Área de Alimentación y Nutrición dependiente de la Unidad de Promoción de la Salud del SEDES Chuquisaca, a la cabeza de la Lic. María Eugenia Cervantes, en coordinación con el Ministerio de Salud, realizó el "Taller de Estrategias de Alimentación y Nutrición", con la participación del Coordinador de la Red de Salud I Sucre, II Tarabuco, III Padilla, IV Azurduy, V Monteagudo, VI Camargo y VII Oropeza, Jefes médicos y responsables de las Unidades de Nutrición Integral (UNI).

El Dr. Henrry Arando C., Jefe de la Unidad de Promoción de la Salud, inauguró el mencionado taller, donde abordaron diversas temáticas;
Estrategias de alimentación y nutrición, Alimentación saludable y el Plan de acción 2022.

